from langchain_core.messages import HumanMessage
from langchain_google_genai import ChatGoogleGenerativeAI

llm=ChatGoogleGenerativeAI(model="gemini-pro-vision",google_api_key="apikey")


message = HumanMessage(
    content=[
        {
            "type": "text",
            "text": "What are the differences between the two images?",
        },
        {
            "type": "image_url",
            "image_url": "data:image/jpeg;base64,"
        },
        {
            "type": "image_url",
            "image_url": "https://idsb.tmgrup.com.tr/ly/uploads/images/2022/12/19/247181.jpg"
        }
    ]
)


response = llm.invoke([message])
print(response.content)

#  The first image is of Lionel Messi looking down at the World Cup trophy after losing the 2014 Final against Germany.

# The second image is of Lionel Messi smiling and holding the World Cup trophy after winning the 2022 Final against France.